import React from 'react';

const ThankYouPage = ({ email, phoneNumber }) => {
    return (
        <div>
            <h1>Submission Successful!</h1>
            <p>Your call has been successfully submitted. The analysis is running and will be emailed to you at {email} in approximately 5 minutes.</p>
            <p>You'll also get a text at {phoneNumber} once it's done!</p>
        </div>
    );
}

export default ThankYouPage;
